import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Login.css";

const SellerSignUpPage = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    FullName: "",
    orgName: "",
    businessNumber: "",
    businessEmail: "",
    password: "",
  });

  const [showPassword, setShowPassword] = useState(false);
  const togglePassword = () => setShowPassword(!showPassword);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Seller Sign Up Data:", formData);
    alert("✅ Seller account created successfully!");
  };

  return (
    <div className="login-container">
      <div className="login-card" style={{ paddingBottom: "40px" }}>
        {/* ======= HEADER ======= */}
        <div className="login-header">
          <h2 className="logo-text">LiftOff</h2>
        </div>

        {/* ======= FORM ======= */}
        <form className="login-form" onSubmit={handleSubmit} noValidate>
          {/* First Name */}
          <div className="form-group" style={{ marginBottom: "14px" }}>
            <label
              htmlFor="firstName"
              style={{
                display: "block",
                marginBottom: "5px",
                color: "#3d4468",
                fontWeight: "600",
              }}
            >
              First Name
            </label>
            <div className="neu-input">
              <input
                type="text"
                id="firstName"
                name="firstName"
                placeholder=" "
                value={formData.firstName}
                onChange={handleChange}
                required
              />
              <label htmlFor="firstName">First Name</label>
            </div>
          </div>

          {/* Last Name */}
          <div className="form-group" style={{ marginBottom: "14px" }}>
            <label
              htmlFor="lastName"
              style={{
                display: "block",
                marginBottom: "5px",
                color: "#3d4468",
                fontWeight: "600",
              }}
            >
              Last Name
            </label>
            <div className="neu-input">
              <input
                type="text"
                id="lastName"
                name="lastName"
                placeholder=" "
                value={formData.lastName}
                onChange={handleChange}
                required
              />
              <label htmlFor="lastName">Last Name</label>
            </div>
          </div>

          {/* Organization Name */}
          <div className="form-group" style={{ marginBottom: "14px" }}>
            <label
              htmlFor="orgName"
              style={{
                display: "block",
                marginBottom: "5px",
                color: "#3d4468",
                fontWeight: "600",
              }}
            >
              Organization Name
            </label>
            <div className="neu-input">
              <input
                type="text"
                id="orgName"
                name="orgName"
                placeholder=" "
                value={formData.orgName}
                onChange={handleChange}
                required
              />
              <label htmlFor="orgName">Organization Name</label>
            </div>
          </div>

          {/* Business Number */}
          <div className="form-group" style={{ marginBottom: "14px" }}>
            <label
              htmlFor="businessNumber"
              style={{
                display: "block",
                marginBottom: "5px",
                color: "#3d4468",
                fontWeight: "600",
              }}
            >
              Business Number
            </label>
            <div className="neu-input">
              <input
                type="text"
                id="businessNumber"
                name="businessNumber"
                placeholder=" "
                value={formData.businessNumber}
                onChange={handleChange}
                required
              />
              <label htmlFor="businessNumber">Business Number</label>
            </div>
          </div>

          {/* Business Email */}
          <div className="form-group" style={{ marginBottom: "14px" }}>
            <label
              htmlFor="businessEmail"
              style={{
                display: "block",
                marginBottom: "5px",
                color: "#3d4468",
                fontWeight: "600",
              }}
            >
              Business Email
            </label>
            <div className="neu-input">
              <input
                type="email"
                id="businessEmail"
                name="businessEmail"
                placeholder=" "
                value={formData.businessEmail}
                onChange={handleChange}
                required
              />
              <label htmlFor="businessEmail">Business Email</label>
            </div>
          </div>

          {/* Password */}
          <div className="form-group" style={{ marginBottom: "14px" }}>
            <label
              htmlFor="password"
              style={{
                display: "block",
                marginBottom: "5px",
                color: "#3d4468",
                fontWeight: "600",
              }}
            >
              Password
            </label>
            <div className="neu-input password-group">
              <input
                type={showPassword ? "text" : "password"}
                id="password"
                name="password"
                placeholder=" "
                value={formData.password}
                onChange={handleChange}
                required
              />
              <label htmlFor="password">Password</label>

              <button
                type="button"
                className={`neu-toggle ${showPassword ? "show-password" : ""}`}
                onClick={togglePassword}
                aria-label="Toggle password visibility"
              >
                <svg
                  className="eye-open"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                >
                  <path d="M1 12s4-8 11-8 11 8 11 8-4 8-11 8-11-8-11-8z" />
                  <circle cx="12" cy="12" r="3" />
                </svg>
                <svg
                  className="eye-closed"
                  viewBox="0 0 24 24"
                  fill="none"
                  stroke="currentColor"
                  strokeWidth="2"
                >
                  <path d="M17.94 17.94A10.07 10.07 0 0 1 12 20c-7 0-11-8-11-8a18.45 18.45 0 0 1 5.06-5.94M9.9 4.24A9.12 9.12 0 0 1 12 4c7 0 11 8 11 8a18.5 18.5 0 0 1-2.16 3.19m-6.72-1.07a3 3 0 1 1-4.24-4.24" />
                  <line x1="1" y1="1" x2="23" y2="23" />
                </svg>
              </button>
            </div>
          </div>

          {/* Submit Button */}
          <button
            type="submit"
            className="neu-button signup-btn"
            style={{ marginTop: "12px" }}
          >
            <span className="btn-text">Sign Up as Seller</span>
          </button>

          {/* Back to Home */}
          <button
            type="button"
            className="neu-button"
            onClick={() => navigate("/")}
            style={{
              background: "#e5e9ef",
              color: "#3d4468",
              fontWeight: "600",
              marginTop: "10px",
              padding: "12px 24px",
            }}
          >
            ← Back to Home Page
          </button>
        </form>
      </div>
    </div>
  );
};

export default SellerSignUpPage;
